import { Injectable } from '@angular/core';

interface IPersonagem {
  id: number;
  nome: string;
  imagem: string;
  votos: number;
}

@Injectable({
  providedIn: 'root'
})
export class Personagens {
  personagens: IPersonagem[] = [
    {
      id: 113231,
      nome: 'Picachu',
      imagem: 'data:image/png;base64,',
      votos: 0,
    },
    {
      id: 12312,
      nome: 'Picachu',
      imagem: 'data:image/png;base64,',
      votos: 0,
    },
    {
      id: 3342342,
      nome: 'Picachu',
      imagem: 'data:image/png;base64,',
      votos: 0,
    },
    {
      id: 4234234,
      nome: 'Picachu',
      imagem: 'data:image/png;base64,',
      votos: 0,
    },
    {
      id: 5234234,
      nome: 'Picachu',
      imagem: 'data:image/png;base64,',
      votos: 0,
    },
  ];

  getPersonagensService(): IPersonagem[] {
    return this.personagens;
  }


    votarPersonagem(id: number) {
      const personagem = this.personagens.find(
        (personagem) => personagem.id === id
      );
      personagem!.votos++;
    }
  }

  
